import React from 'react'
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
const Stack = createNativeStackNavigator()
import WelcomeScreen from "./Components/welcome.js"
import QuizScreen from "./Components/quiz.js"
import SummaryScreen from "./Components/summary.js"

export default function App() {
  let questions = [{
    "prompt": "Which of these U.S. states does NOT border Canada?",
    "type": "multiple-choice",
    "choices": [
      "Indiana",
      "Alaska",
      "Maine",
      "Minnesota",
    ],
    "correct": 0
  },
  {
    "prompt": "Which countries does NOT require a U.S. passport to visit?",
    "type": "multiple-answer",
    "choices": [
      "Puerto Rico",
      "Bahamas",
      "Guam",
      "Mexico",
    ],
  "correct": [0,2]
  },
  {
    "prompt": "China is the largest country in the world.",
    "type": "true-false",
    "choices": [
      "True",
      "False",
    ],
    "correct": 1
  }]
  return (
    <NavigationContainer> 
      <Stack.Navigator initialRouteName="Welcome">
        <Stack.Screen name="Welcome" component={WelcomeScreen}/>
        <Stack.Screen name="Quiz" component={QuizScreen} initialParams={{questions: questions, index: 0}}/>
        <Stack.Screen name="Summary" component={SummaryScreen} initialParams={{questions: questions}}/>
      </Stack.Navigator>
    </NavigationContainer>
  );
}
